import React from "react";

function Home({ user }) {
  return (
    <div>
      <h2>Home Page</h2>
      {user ? (
        <p>Welcome {user.username}</p> 
      ) : (
        <p>Welcome to the Home Page</p>
      )}
    </div>
  );
}

export default Home;
